import React, {Component} from 'react';
import Particles from 'react-particles-js';

function Page(){
	return(
		<div>
		   <Particles 
	        params={{ 
	          particles: { 
	            number: { 
	              value: 200, 
	              density: { 
	                enable: true, 
	                value_area: 1000, 
	              } 
	            }, 
	          }, 
	        }} 
	      /> 
	    </div>
	)
}

export default Page;
